column8:
トイプードル、チワワ、ミニチュアダックスなど人気の犬種の作り方を解説した図書「鈴山キナコのアニマルデコレーション 粘土で作る 動物マスコット」で使われている、アニマルデコレーション専用パーツ「さし目　丸」です。<br><br>

◆サイズ（約）：5mm/5×長さ10mm
　　　　　　　　 　6mm/6×長さ10mm
<br><br>
