容量：500g<p>天然の石から作った石塑粘土。彫塑・工芸・人形などさまざまな素材として活用できます。ホワイト・ブラウン・グリーンの3タイプがあります。乾燥後に彫刻刀などでの加工ができ、アクリル絵具での彩色・混色も可能。
